    data: |
      SELECT + + col2 + 70 * cor0.col2 * col1 - + ( - col2 + - ( - cor0.col0 ) ) * - col0 * 91 AS col2 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
